//         <p class="copyright">Harpreet Randhawa</p>
//         <p class="copyright">Created using HTML & CSS</p>
//       </div>
//     );
//   }
// }

class Nav extends Component {
  render() {
    return (
      <ReactBootStrap.Navbar
        collapseOnSelect
        expand="xl"
        bg="dark" // dark, primary, danger
        variant="dark"
        fixed="top"
        className="navtext"
      >
        <ReactBootStrap.Navbar.Brand href="#home">
          Harpreet Randhawa
          <img src={logo} className="App-logo" alt="logo" />
        </ReactBootStrap.Navbar.Brand>
        <ReactBootStrap.Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <ReactBootStrap.Navbar.Collapse id="responsive-navbar-nav">
          <ReactBootStrap.Nav className="mr-auto" text-allign="center">
            <ReactBootStrap.Nav.Link href="#home" className="navtext">
              Home
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#aboutme" className="navtext">
              About Me
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#resume" className="navtext">
              Resume
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#comments" className="navtext">
              Comments
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#contact" className="navtext">
              Contact
            </ReactBootStrap.Nav.Link>
          </ReactBootStrap.Nav>
          <ReactBootStrap.Nav></ReactBootStrap.Nav>
        </ReactBootStrap.Navbar.Collapse>
      </ReactBootStrap.Navbar>
    );
  }
}

class Header extends Component {
  render() {
    return (
      <header className="App-header">
        <div className="container5">
          <div id="box">
            <img src="https://i.imgur.com/JpeUHd0.jpg" alt="Me" id="cover" />
          </div>
        </div>
        <br></br>
        {/* <h1 className="App-title"> Harpreet Randhawa</h1>
        <h3> Programmer</h3> */}
        <div className="titlebox">
          <h1 className="App-title"> Harpreet Randhawa</h1>
          <p className="languages">
            {" "}
            ---------------------------------------------------------
          </p>
          <pre className="languages">Java C SQL HTML CSS Javascript React</pre>
        </div>
      </header>
    );
  }
}
{
}

const AboutMe = () => {
  return (
    <div className="App-header-aboutme">
      <img
        src="https://i.imgur.com/ZD3Ml0N.jpg"
        alt="friends"
        className="aboutmepictures"
      />
      <img
        src="https://i.imgur.com/RBjENph.jpg"
        alt="hike"
        className="aboutmepictures"
      />

      <img
        src="https://i.imgur.com/ZD3Ml0N.jpg"
        alt="lift"
        className="aboutmepictures"
      />
      <img
        src="https://i.imgur.com/ZD3Ml0N.jpg"
        alt="cat"
        className="aboutmepictures"
      />

      <div className="aboutmecontainer">
        <h4>
          <h1 className="aboutmetext">About me!</h1>
        </h4>
        <p className="welcome">
          {" "}
          Hello and welcome to my website! My name is Harpreet Randhawa and I am
          majoring in Computer Science at Rutgers University. I've always been
          interested in technology ever since I was a child and once I learned
          that software, technology, games and etc. were able to be accomplished
          due to code, that really got me into the field. In my free time I love
          spending times with my friends and going hiking once in awhile to
          enjoy the beauty of nature. I started lifting torwards the end of High
          School and have fell in love with it ever since. Also here's a bonus
          of my cat named Mow!{" "}
        </p>
      </div>
    </div>
  );
};

const Resume = () => {
  return (
    <div className="App-header-resume">
      {/* <img src="https://i.imgur.com/rtPObQD.jpg" alt="resume" /> */}
      <img
        src="https://i.imgur.com/FRkdFhb.jpg"
        alt="resume"
        className="resume"
      />
    </div>
  );
};

const Contact = () => {
  return (
    <div className="App-header-contact">
      <p>Contact information</p>
      <p>Email: Harpreetsrandhawa99@gmail.com</p>
      <img
        src="https://myclouddoor.com/wp-content/uploads/2019/11/Linkedin-logo.png"
        alt="linkedinlogo"
        className="linkedinlogo"
      />
      <p>LinkedIn: https://www.linkedin.com/in/harpreet-randhawa-965695159/</p>
      <p>Phone Number: 848-228-6014</p>
    </div>
  );
};

const Comments = () => {
  return (
  <div className="App-header-comments">

  </div>
  );
};

class App extends Component {
  render() {
    return (
      <div className="App">
        <Nav />
        <Header />
        <AboutMe />
        <Resume />
        <Comments />
        <Contact />
      </div>
    );
  }
}

export default App;
